Second $project Stage Producing Unexpected Result in MongoDB Aggregation<p>I am trying to run some aggregation in my MongoDB backend where I calculate a value and then add that calculated value to another value. The first step is working, but the second step produces a value of <code>null</code>, and I'm trying to understand why, and how to fix it.</p>

<p>This is what my aggregation look like:</p>

<pre><code>db.staff.aggregate({
    $project: {
      _id: 1,
      "workloadSatisfactionScore": {
          $cond: [ { $eq: [ "$workload.shiftAvg", 0 ] }, "N/A", { $divide: [ "$workload.shiftAvg", "$workload.weeklyShiftRequest.minimum" ] } ]
      }
    },
    $project: {
      _id: 1,
      totalScore: {
        $sum: [ "$workloadSatisfactionScore", 10 ]
      },
    }
})
</code></pre>

<p>Even though the first <code>$project</code> stage produces documents with a numeric result or <code>null</code> for 'workloadSatisfactionScore', after the second <code>$project</code> stage, ALL documents have a value of <code>null</code> for 'totalScore'.</p>

<p>What I should get is whatever the value of 'workloadSatisfactionScore' is, added to 10. But as I say, all I get is <code>null</code> for all documents. What looks incorrect here?</p>

<p>As an example, one particular document in my collection returns a value of <code>0.9166666666666666</code> for "workloadSatisfactionScore". So when that is plugged into the second <code>$project</code> stage I'd expect a value of <code>10.9166666666666666</code> for 'totalScore'. But, as I say, instead I get <code>null</code> for that document, and all other documents.</p>

