Aggregate function issue with latest version of MongoC# Driver<p>I have .NET Application that uses MongoDB.  Current driver I am using is 1.9.2.  I am trying to upgrade it to 2.7.0.</p>

<p>I am having some difficulty in getting an Aggregate query to work in the new version:</p>

<p>The working code in version 1.9.2 of the driver is:</p>

<pre><code>    public IEnumerable&lt;Car&gt; GetCarsModifiedInPeriod(DateTimeOffset dateFrom, DateTimeOffset dateTo)
    {
        var matchRequestFromDate = new BsonDocument
        {
            {
                "$match",
                new BsonDocument
                {
                    {
                        // Filter out those too recently modified
                       "LastUpdatedOn.0", new BsonDocument {{"$gte", dateFrom.Ticks}}
                    }
                }
            }
        };
        var matchRequestToDate = new BsonDocument
        {
            {
                "$match",
                new BsonDocument
                {
                    {
                        // Filter out those too recently modified
                        "LastUpdatedOn.0", new BsonDocument {{"$lte", dateTo.Ticks}}
                    }
                }
            }
        };

        var cars = collection.Aggregate(new AggregateArgs
        {
            Pipeline = new[] { matchRequestFromDate, matchRequestToDate},              
            AllowDiskUse = true,
            // Setting the OutputMode to Cursor allows us to return Mongo Doc Size &gt; 16 MB - in the case when a large date  
            // range is used or a large number of cars were modified in a short period of time
            OutputMode = AggregateOutputMode.Cursor
        }).Select(r =&gt; r.Values.Select(c =&gt; c.AsObjectId.ToString()).First());

        var returnData = collection.AsQueryable().Where(c =&gt; cars.Contains(c.Id)).Select(c =&gt; c);

        return returnData;
    }
</code></pre>

<p>With a breakpoint set on returnData for the two periods specified I am getting a count of 25 cars which is what I expect.</p>

<p>This is how I have attempted to re-write for 2.7.0 version of driver:</p>

<pre><code>    public IEnumerable&lt;Car&gt; GetCarsModifiedInPeriod(DateTimeOffset dateFrom, DateTimeOffset dateTo)
    {
        var matchRequestFromDate = new BsonDocument
