How to concatenate 2 integer values into a single string in Spring MongoDB<p>My document in a aggregation stage looks like this:</p>
<pre><code>{
    month: 9,
    year: 2017
}
</code></pre>
<p>Now I would like it to becomes:</p>
<pre><code>{
    time: &quot;9/2017&quot;
}
</code></pre>
<p>In Mongo shell (v3.6.4) I can do this and it works as expected:</p>
<pre><code>$concat: [{$substr:[&quot;$month&quot;, 0, -1]}, &quot;/&quot;, {$substr:[&quot;$year&quot;, 0, -1]}]
</code></pre>
<p>In version 4.0 there is a <code>$toString</code> operator do the same trick <code>$substr</code>.</p>
<p>But there are no equivalent in Spring MongoDB, some topics on Stack Overflow use the code <code>.addExpression(&quot;concat(month,'/',year)&quot;)</code>. This code snippet works if only month/year field is a String like <code>{month: &quot;9&quot;}</code> but not <code>{month: 9}</code>.</p>

